import React from "react";

export const SearchForm = (props) => {
  const { searchText, onChange, onClick } = props;
  return (
    <>
      <div className="input-area">
        <input value={searchText} onChange={onChange} />
        <button onClick={onClick}>検索</button>
      </div>
    </>
  );
}
